import React, { useState, useEffect } from "react";
import Grid from "@material-ui/core/Grid";
import ObraSocialForm from "./ObraSocialForm";
import { makeStyles } from "@material-ui/core/styles";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEdit } from "@fortawesome/free-solid-svg-icons";

export default function ObraSocial() {
  const classes = useStyles();
  const [obrasSociales, setObrasSociales] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8080/obraSocial", {
      method: "GET",
      headers: { "Content-Type": "application/json" },
    })
      .then((response) => response.json())
      .then((data) => setObrasSociales(data));
  }, []);

  return (
    <Grid container>
      <Grid item xs={12} sm={6} md={6} lg={6} className={classes.listaOS}>
        <div className={classes.headerOs}>Obras Sociales</div>
        <Grid container>
          {obrasSociales.map((obraSocial) => {
            return (
              <>
                <Grid
                  item
                  xs={9}
                  sm={9}
                  md={9}
                  lg={9}
                  className={classes.itemObraSocial}
                >
                  {obraSocial.nombre}
                </Grid>
                <Grid
                  item
                  xs={3}
                  sm={3}
                  md={3}
                  lg={3}
                  className={classes.itemObraSocial}
                >
                  <FontAwesomeIcon icon={faEdit} />
                </Grid>
              </>
            );
          })}
        </Grid>
      </Grid>
      <Grid item xs={12} sm={6} md={6} lg={6} className={classes.borderForm}>
        <ObraSocialForm />
      </Grid>
    </Grid>
  );
}
const useStyles = makeStyles((theme) => ({
  headerOs: {
    textAlign: "center",
    paddingTop: 20,
  },
  borderForm: {
    borderLeft: "1px solid #000",
    height: "100%",
  },
  listaOS: {
    height: "100%",
  },
  itemObraSocial: {
    padding: 10,
    borderBottom: "1px solid #c4c4c4",
    textAlign: "center",
  },
}));
